INSERT INTO `SysNotice` VALUES ('07720007-98e0-11ea-843b-00163e0dc02e', '广西公安厅：打着虚拟货币、区块链等幌子的网络违法犯罪欺骗性强', 'Guangxi Public Security Department: Under the guise of virtual currency and blockchain, cyber crimes are highly deceptive', '广西壮族自治区公安厅召开新闻发布会通报，2019 年，当地公安机关共破获组织、领导传销活动犯罪案件 1021 起，涉案资金 2.71 亿元，打击成效连续三年位居全国第一。广西警方介绍，近年来当地公安机关持续的高压严打取得了一定的成效，但传销违法犯罪依然活跃，花样手法不断更新、层出不穷。打着消费返利、虚拟货币、区块链、炒外汇、爱心慈善、军民融合、一带一路等幌子实施的网络传销违法犯罪名目繁多，欺骗性强，诱惑性大。下一步，广西壮族自治区公安厅将深入开展全区「广西亮剑·2020 严打传销」专项行动，清理整顿一批传销洗脑场所，形成打击防范传销的压倒性态势。（人民网）', 'The Public Security Department of the Guangxi Zhuang Autonomous Region held a press conference to announce that in 2019, local public security organs cracked 1021 criminal cases of organizing and leading pyramid scheme activities, involving funds of 271 million yuan. The crackdown ranks first in the country for three consecutive years. According to the Guangxi police, in recent years, the local public security organs have continued to exert high-pressure crackdowns and achieved certain results, but MLM violations and crimes are still active, and tricks are constantly updated and endless. Under the guise of consumer rebates, virtual currency, blockchain, foreign exchange speculation, charity, military-civilian integration, and the Belt and Road Initiative, there are many illegal and criminal online marketing programs, which are highly deceptive and tempting. In the next step, the Public Security Department of Guangxi Zhuang Autonomous Region will carry out a special operation of “Guangxi Liangjian · 2020 Strict MLM” in the whole region, clean up and rectify a batch of MLM brainwashing places, and form an overwhelming situation to combat MLM prevention. (People\'s Network)', NULL, '2020-05-18 16:17:35');
INSERT INTO `SysNotice` VALUES ('0778918f-98e0-11ea-843b-00163e0dc02e', '委内瑞拉石油币或已暗中硬分叉', 'Venezuelan oil coin may have been secretly forked', '委内瑞拉政府在5月5日关闭Petro区块链进行维护。但是有消息表明石油币已经经历了硬分叉或链分裂（Chain Split）。石油币区块浏览器显示，石油币的新“创世区块”是在5月5日产生，不过那天Petro区块链已经下线进行维护。而另一个官方的石油币区块浏览器显示2018年10月13日创世区块便已经诞生。这意味着这是两条不一样的区块链。（Decrypt）', 'The Venezuelan government shut down the Petro blockchain for maintenance on May 5. However, there is news that Petroleum Coin has undergone a hard fork or chain split. The Petroleum Block Browser shows that the new \"Genesis Block\" of Petroleum Coin was generated on May 5, but the Petro blockchain has been offline for maintenance that day. And another official petcoin block browser shows that the genesis block was born on October 13, 2018. This means that these are two different blockchains. (Decrypt)', NULL, '2020-05-18 16:17:35');
INSERT INTO `SysNotice` VALUES ('077f2720-98e0-11ea-843b-00163e0dc02e', '报告：到2025年区块链企业的市场规模将达到210.7亿美元', 'Report: The market size of blockchain enterprises will reach USD 21.07 billion by 2025', '根据GlobeNewswire在5月12日发布的报告，《财富商业洞察》(Fortune Business Insights) 的一项新研究估计，到2025年区块链技术市场的规模将达到210 亿美元。根据 《财富商业洞察》报告，全球区块链技术市场增长的主要原因是，全球范围内越来越多的企业从内部增加了对区块链研发的投资。该研究还预计，公众或政府部门对市场上产品的研究和监管审批的兴趣不断上升，也将加速区块链行业的扩张。\n报告称，IBM 将在企业区块链领域占据主导地位。其他主要参与者还包括Linux基金会、Chain Inc.、Oracle Corporation、Deloitte、Consensus Systems、Microsoft Corporation、Schvey,Inc.、Altoros、Bits,nc.、Altoros和VironIT等公司。该报告调查了全球多个行业，包括政府、医疗保健、银行、金融服务和保险 (BFSI)。', 'According to a report released by GlobeNewswire on May 12, a new study by Fortune Business Insights estimates that the blockchain technology market will reach $ 21 billion by 2025. According to the \"Fortune Business Insights\" report, the main reason for the growth of the global blockchain technology market is that more and more companies worldwide have increased investment in blockchain research and development from within. The study also predicts that the increasing interest of the public or government departments in the research and regulatory approval of products on the market will also accelerate the expansion of the blockchain industry.\nAccording to the report, IBM will dominate the enterprise blockchain. Other major players include the Linux Foundation, Chain Inc., Oracle Corporation, Deloitte, Consensus Systems, Microsoft Corporation, Schvey, Inc., Altoros, Bits, nc., Altoros, and VironIT. The report surveyed multiple industries around the world, including government, healthcare, banking, financial services, and insurance (BFSI).', NULL, '2020-05-18 16:17:35');
INSERT INTO `SysNotice` VALUES ('0785c6f7-98e0-11ea-843b-00163e0dc02e', 'V神致歉：自己未说以太坊2.0在7月上线', 'V God apologizes: he did not say that Ethereum 2.0 will be launched in July', '以太坊联合创始人Vitalik Buterin在此前共识大会上被问到以太坊2.0是否在2020年7月上线时回答Yes，但很快便遭到以太坊社区质疑，开发人员Marco Levarato认为，目前官方多客户端测试网还未正式上线，如果上线的话，至少需要两个月时间测试网络问题，但现在已五月，因此七月上线根本不可能。对此，Vitalik Buterin在推特上做出澄清，自己在参加网络共识大会时没有听清问题，自己并未说7月会上线，并且就此事道歉认错。', 'Ethereum co-founder Vitalik Buterin was asked at the previous consensus conference whether Ethereum 2.0 answered Yes when it was launched in July 2020, but was quickly questioned by the Ethereum community. Developer Marco Levarato believes that the current official multi-client The test network has not been officially launched yet. If it is online, it will take at least two months to test the network problem, but it is now in May, so it is impossible to go online in July. In this regard, Vitalik Buterin clarified on Twitter that he did not hear the problem when he participated in the Internet Consensus Conference. He did not say that he would go online in July and apologized for the mistake.', NULL, '2020-05-18 16:17:35');
INSERT INTO `SysNotice` VALUES ('07890B69B7C44860B33FC6F585159DB6', '瓦特合约正式启动做市商招募计划', 'Watt contract officially launched the market maker recruitment plan', '瓦特合约首期做市商招募计划已于5月13日启动，截止日期为5月31日。\n瓦特合约针对做市商提供Maker手续费返还，首期加入还可额外获得三个月的现金奖励。\n瓦特合约是WBF交易所旗下的永续合约交易平台，由顶尖团队合力打造。瓦特合约团队由来自中金所、汤森路透及知名投行、对冲基金的资深金融人士构成，具备丰富的全球金融衍生品市场经验。\nWBF是增长势头最迅猛、热度最高的交易所之一。截至目前，平台注册用户已经超过450万。', 'The first phase of the Watt Contract Market Maker Recruitment Program was launched on May 13 and the deadline is May 31.\nThe Watt contract provides a refund of Maker\'s handling fee for market makers, and you can get an additional three months of cash rewards when you join the first phase.\nThe Watt contract is a perpetual contract trading platform under the WBF Exchange and is jointly built by top teams. The Watt contract team is composed of senior financial professionals from the China Securities Exchange, Thomson Reuters, well-known investment banks and hedge funds, and has extensive experience in the global financial derivatives market.\nWBF is one of the fastest growing and hottest exchanges. As of now, the platform has registered more than 4.5 million users.', NULL, '2020-05-14 17:25:25');
INSERT INTO `SysNotice` VALUES ('078c52c7-98e0-11ea-843b-00163e0dc02e', 'BitMEX诉讼文件公开：原告称交易所有欺诈、虚假陈述和其他罪名', 'BitMEX litigation documents open: plaintiff claims all fraud, misrepresentation and other charges in the transaction', '今年4月下旬，美国旧金山加利福尼亚州高等法院对BitMEX提起诉讼，指控该交易所多项罪名成立，并要求陪审团进行审判，第一次修改后的诉讼文件已向公众公布。原告指控BitMEX犯有欺诈、违约、违反诚信和公平交易、不当得利和虚假陈述等罪名。\n据悉，除了法律问题外，BitMEX自3月份以来一直在努力恢复失去的用户。3月12日交易所出现宕机，许多人因此完全停止了使用。4月8日的一份报告指出，BitMEX持有的比特币在过去一个月下跌了25％。（BeInCrypto）', 'In late April of this year, the California High Court in San Francisco, the United States, filed a lawsuit against BitMEX, accusing the exchange of multiple convictions and demanding a jury trial. The first revised litigation documents have been released to the public. The plaintiff charged BitMEX with fraud, breach of contract, breach of integrity and fair dealing, improper profit and false statements.\nIt is reported that in addition to legal issues, BitMEX has been working hard to recover lost users since March. On March 12, the exchange went down, and many people stopped using it completely. A report on April 8 pointed out that Bitcoin held by BitMEX has fallen by 25% in the past month. (BeInCrypto)', NULL, '2020-05-18 16:17:35');
INSERT INTO `SysNotice` VALUES ('07c7f899-98e0-11ea-843b-00163e0dc02e', '有主力在9280美元附近买入1000万张平空', 'There is a main force to buy 10 million flats around $ 9280', 'AICoin PRO版K线主力成交数据显示：今天13:25分，BitMEX XBT永续合约上出现一笔买入数量为1000万张，买入价格为9279.5美元的主动买入单子。结合持仓量指标，成交后持仓量下降明显，可判断为主力买入平空。值得注意的是，该平仓位置为凌晨拉升后横盘调整三角型下沿线的支撑位。 成交后，比特币价格结束横盘拉升至当前的9532美元。', 'AICoin PRO version of the K-line main transaction data shows that at 13:25 today, there was an active purchase order on the BitMEX XBT perpetual contract with a purchase quantity of 10 million and a purchase price of $ 9279.5. Combined with the position indicator, after the transaction, the position decreased significantly, and it can be judged that the main buying is short. It is worth noting that the position for closing the position is the support level along the lower side of the triangle adjustment after the early morning rise. After the transaction, the bitcoin price ended sideways and rose to the current USD 9532.', NULL, '2020-05-18 16:17:35');
INSERT INTO `SysNotice` VALUES ('07ceece5-98e0-11ea-843b-00163e0dc02e', 'TACU母公司正与泰国著名私募股权基金洽谈泰交所上市融资事宜', 'TACU\'s parent company is negotiating the listing and financing of the Thai Stock Exchange with a well-known private equity fund in Thailand', '日前，TACU亚交所母公司亚洲数字资产交易有限公司正与泰国著名私募股权基金PrimeStree Group开展洽谈，沟通亚洲数字资产交易有限公司在泰国证券交易所（“泰交所”）上市融资事宜。\n早在2020年初，亚洲数字资产交易有限公司内部已成立上市委员会及上市工作小组，计划通过首次公开发行股票的方式在泰国证券交易所上市，此次与PrimeStreet Group合作，将进一步加快该公司在泰交所上市的步伐。\nTACU亚交所成立于2017年11月，目前每日活跃用户超5万。\nPrimeStree Group是泰国顶级的投资银行，管理咨询和基金管理服务平台，为投资者和投资公司提供一流的服务，先进的投资工具和投资平台。', 'A few days ago, the Asian Digital Asset Trading Co., Ltd., the parent company of the TACU Asian Exchange, is negotiating with PrimeStree Group, a well-known private equity fund in Thailand, to discuss the financing of the listing of Asian Digital Asset Trading Co., Ltd. on the Thai Stock Exchange (\"Thai Exchange\").\nAs early as early 2020, Asia Digital Asset Trading Co., Ltd. has established a listing committee and a listing working group to plan to list on the Thai Stock Exchange through an initial public offering. The cooperation with PrimeStreet Group this time will further accelerate the company ’s listing in Thailand. The pace of stock exchange listing.\nThe TACU Asian Exchange was established in November 2017 and currently has over 50,000 daily active users.\nPrimeStree Group is Thailand\'s top investment bank, management consulting and fund management service platform, providing investors and investment companies with first-class services, advanced investment tools and investment platforms.', NULL, '2020-05-18 16:17:35');
INSERT INTO `SysNotice` VALUES ('07d5997c-98e0-11ea-843b-00163e0dc02e', '监测：Upbit被盗ETH开启新一轮洗钱过程，超2万ETH涉及', 'Monitoring: Upbit stolen ETH starts a new round of money laundering process, involving more than 20,000 ETH', '北京链安Chainsmap监测系统发现，近24小时，Upbit被盗ETH开启了近期第二轮洗钱过程，已经有23622ETH进入洗钱流程，清空了3个Upbit被盗ETH相关的剩余核心存币地址。此前，在北京时间5月6日到7日，距Upbit被盗ETH上一次洗钱过程超百天后启动的洗钱过程中，近4万ETH进入洗钱过程，清空6个Upbit被盗ETH相关剩余核心存币地址。\n至此，Upbit相关核心存币地址尚存4个未被清空，剩余的尚未进入洗钱流程的ETH仅剩36000余枚，从目前来看，相关ETH大都会拆分后汇聚到核心地址分发（疑似场外交易）进而进入交易所，有个别交易所的地址多次参与接收相关涉事ETH。据悉，在Upbit被盗后，相关司法部门也已经介入，在业界配合和司法措施下，部分ETH已经在相关交易所被冻结。', 'Beijing Chainan Chainsmap monitoring system found that in the past 24 hours, Upbit stolen ETH started the second round of recent money laundering process. 23622 ETH has entered the money laundering process and emptied 3 remaining Upbit stolen ETH-related core deposit addresses. Earlier, during the money laundering process that started more than 100 days after the last money laundering process of Upbit\'s stolen ETH on May 6-7, Beijing time, nearly 40,000 ETH entered the money laundering process, clearing 6 Upbit stolen ETH-related remaining core deposits Currency address.\nAt this point, there are 4 remaining core deposit addresses of Upbit that have not been emptied, and the remaining ETH that has not yet entered the money laundering process is only 36,000 pieces. From the current point of view, the relevant ETH will be split and aggregated to the core address distribution (suspected field) Foreign transactions) and then enter the exchange, and the addresses of individual exchanges have repeatedly participated in receiving relevant ETH. It is reported that after Upbit was stolen, the relevant judicial departments have also intervened. With the cooperation of the industry and judicial measures, some ETH has been frozen on the relevant exchanges.', NULL, '2020-05-18 16:17:35');
INSERT INTO `SysNotice` VALUES ('07dc4a4f-98e0-11ea-843b-00163e0dc02e', 'CoinBene俄罗斯分站与媒体BitNevoy达成深度战略合作', 'CoinBene Russian branch reached in-depth strategic cooperation with media BitNevoy', '据官方消息，CoinBene满币与俄罗斯媒体BitNevoy达成深度战略合作，双方将围绕虚拟货币合约交易、全球市场宣发、资源对接、渠道商招募以及全方面业务拓展展开全方位合作，帮助用户有更好的合约体验。\nBitNevoy是集行业新闻、资讯、行情等一站式区块链服务于一体的俄罗斯知名区块链媒体。\nCoinBene满币数字资产交易平台在全球180多个国家和地区拥有500多万用户，日活跃用户数超10万，日均交易额30亿美元。2019年初，平台战略布局合约衍生品市场，主要为投资者提供以BTC、USDT进行结算且安全、稳定的永续合约服务，CoinBene满币将继续深化与社区、媒体合作。', 'According to official news, CoinBene Mancoin and Russian media BitNevoy have reached an in-depth strategic cooperation. The two parties will conduct comprehensive cooperation around virtual currency contract transactions, global market announcements, resource docking, channel dealer recruitment and all-round business development to help users have better Contract experience.\nBitNevoy is a well-known Russian blockchain media that integrates industry news, information, market and other one-stop blockchain services.\nThe CoinBene full-currency digital asset trading platform has more than 5 million users in more than 180 countries and regions around the world, with more than 100,000 daily active users and an average daily transaction volume of 3 billion US dollars. At the beginning of 2019, the platform strategically deploys the contract derivatives market, mainly providing investors with BTC, USDT settlement, safe and stable perpetual contract services. CoinBene Full Coin will continue to deepen cooperation with the community and media.', NULL, '2020-05-18 16:17:36');
