INSERT INTO `SysNotice` VALUES ('625FBC5038994E9D87CE7B465EA22374', 'BitMEX诉讼文件公开：原告称交易所有欺诈、虚假陈述和其他罪名', 'BitMEX litigation documents open: plaintiff claims all fraud, misrepresentation and other charges in the transaction', '今年4月下旬，美国旧金山加利福尼亚州高等法院对BitMEX提起诉讼，指控该交易所多项罪名成立，并要求陪审团进行审判，第一次修改后的诉讼文件已向公众公布。原告指控BitMEX犯有欺诈、违约、违反诚信和公平交易、不当得利和虚假陈述等罪名。\n据悉，除了法律问题外，BitMEX自3月份以来一直在努力恢复失去的用户。3月12日交易所出现宕机，许多人因此完全停止了使用。4月8日的一份报告指出，BitMEX持有的比特币在过去一个月下跌了25％。（BeInCrypto）', 'In late April of this year, the California High Court in San Francisco, the United States, filed a lawsuit against BitMEX, accusing the exchange of multiple convictions and demanding a jury trial. The first revised litigation documents have been released to the public. The plaintiff charged BitMEX with fraud, breach of contract, breach of integrity and fair dealing, improper profit and false statements.\nIt is reported that in addition to legal issues, BitMEX has been working hard to recover lost users since March. On March 12, the exchange went down, and many people stopped using it completely. A report on April 8 pointed out that Bitcoin held by BitMEX has fallen by 25% in the past month. (BeInCrypto)', NULL, '2020-05-14 17:25:41');
INSERT INTO `SysNotice` VALUES ('6C8F7F51BC924362AFFD142A9BBA597C', '有主力在9280美元附近买入1000万张平空', 'There is a main force to buy 10 million flats around $ 9280', 'AICoin PRO版K线主力成交数据显示：今天13:25分，BitMEX XBT永续合约上出现一笔买入数量为1000万张，买入价格为9279.5美元的主动买入单子。结合持仓量指标，成交后持仓量下降明显，可判断为主力买入平空。值得注意的是，该平仓位置为凌晨拉升后横盘调整三角型下沿线的支撑位。 成交后，比特币价格结束横盘拉升至当前的9532美元。', 'AICoin PRO version of the K-line main transaction data shows that at 13:25 today, there was an active purchase order on the BitMEX XBT perpetual contract with a purchase quantity of 10 million and a purchase price of $ 9279.5. Combined with the position indicator, after the transaction, the position decreased significantly, and it can be judged that the main buying is short. It is worth noting that the position for closing the position is the support level along the lower side of the triangle adjustment after the early morning rise. After the transaction, the bitcoin price ended sideways and rose to the current USD 9532.', NULL, '2020-05-14 17:25:44');
INSERT INTO `SysNotice` VALUES ('8D2ED638691347B8B5433D639CD94DC5', 'TACU母公司正与泰国著名私募股权基金洽谈泰交所上市融资事宜', 'TACU\'s parent company is negotiating the listing and financing of the Thai Stock Exchange with a well-known private equity fund in Thailand', '日前，TACU亚交所母公司亚洲数字资产交易有限公司正与泰国著名私募股权基金PrimeStree Group开展洽谈，沟通亚洲数字资产交易有限公司在泰国证券交易所（“泰交所”）上市融资事宜。\n早在2020年初，亚洲数字资产交易有限公司内部已成立上市委员会及上市工作小组，计划通过首次公开发行股票的方式在泰国证券交易所上市，此次与PrimeStreet Group合作，将进一步加快该公司在泰交所上市的步伐。\nTACU亚交所成立于2017年11月，目前每日活跃用户超5万。\nPrimeStree Group是泰国顶级的投资银行，管理咨询和基金管理服务平台，为投资者和投资公司提供一流的服务，先进的投资工具和投资平台。', 'A few days ago, the Asian Digital Asset Trading Co., Ltd., the parent company of the TACU Asian Exchange, is negotiating with PrimeStree Group, a well-known private equity fund in Thailand, to discuss the financing of the listing of Asian Digital Asset Trading Co., Ltd. on the Thai Stock Exchange (\"Thai Exchange\").\nAs early as early 2020, Asia Digital Asset Trading Co., Ltd. has established a listing committee and a listing working group to plan to list on the Thai Stock Exchange through an initial public offering. The cooperation with PrimeStreet Group this time will further accelerate the company ’s listing in Thailand. The pace of stock exchange listing.\nThe TACU Asian Exchange was established in November 2017 and currently has over 50,000 daily active users.\nPrimeStree Group is Thailand\'s top investment bank, management consulting and fund management service platform, providing investors and investment companies with first-class services, advanced investment tools and investment platforms.', NULL, '2020-05-14 17:25:47');
INSERT INTO `SysNotice` VALUES ('AE3693DCB4014815917BCD62612C92B2', '监测：Upbit被盗ETH开启新一轮洗钱过程，超2万ETH涉及', 'Monitoring: Upbit stolen ETH starts a new round of money laundering process, involving more than 20,000 ETH', '北京链安Chainsmap监测系统发现，近24小时，Upbit被盗ETH开启了近期第二轮洗钱过程，已经有23622ETH进入洗钱流程，清空了3个Upbit被盗ETH相关的剩余核心存币地址。此前，在北京时间5月6日到7日，距Upbit被盗ETH上一次洗钱过程超百天后启动的洗钱过程中，近4万ETH进入洗钱过程，清空6个Upbit被盗ETH相关剩余核心存币地址。\n至此，Upbit相关核心存币地址尚存4个未被清空，剩余的尚未进入洗钱流程的ETH仅剩36000余枚，从目前来看，相关ETH大都会拆分后汇聚到核心地址分发（疑似场外交易）进而进入交易所，有个别交易所的地址多次参与接收相关涉事ETH。据悉，在Upbit被盗后，相关司法部门也已经介入，在业界配合和司法措施下，部分ETH已经在相关交易所被冻结。', 'Beijing Chainan Chainsmap monitoring system found that in the past 24 hours, Upbit stolen ETH started the second round of recent money laundering process. 23622 ETH has entered the money laundering process and emptied 3 remaining Upbit stolen ETH-related core deposit addresses. Earlier, during the money laundering process that started more than 100 days after the last money laundering process of Upbit\'s stolen ETH on May 6-7, Beijing time, nearly 40,000 ETH entered the money laundering process, clearing 6 Upbit stolen ETH-related remaining core deposits Currency address.\nAt this point, there are 4 remaining core deposit addresses of Upbit that have not been emptied, and the remaining ETH that has not yet entered the money laundering process is only 36,000 pieces. From the current point of view, the relevant ETH will be split and aggregated to the core address distribution (suspected field) Foreign transactions) and then enter the exchange, and the addresses of individual exchanges have repeatedly participated in receiving relevant ETH. It is reported that after Upbit was stolen, the relevant judicial departments have also intervened. With the cooperation of the industry and judicial measures, some ETH has been frozen on the relevant exchanges.', NULL, '2020-05-14 17:25:50');
INSERT INTO `SysNotice` VALUES ('B141E2B2FC0949E7A5D4D886C06A5166', 'CoinBene俄罗斯分站与媒体BitNevoy达成深度战略合作', 'CoinBene Russian branch reached in-depth strategic cooperation with media BitNevoy', '据官方消息，CoinBene满币与俄罗斯媒体BitNevoy达成深度战略合作，双方将围绕虚拟货币合约交易、全球市场宣发、资源对接、渠道商招募以及全方面业务拓展展开全方位合作，帮助用户有更好的合约体验。\nBitNevoy是集行业新闻、资讯、行情等一站式区块链服务于一体的俄罗斯知名区块链媒体。\nCoinBene满币数字资产交易平台在全球180多个国家和地区拥有500多万用户，日活跃用户数超10万，日均交易额30亿美元。2019年初，平台战略布局合约衍生品市场，主要为投资者提供以BTC、USDT进行结算且安全、稳定的永续合约服务，CoinBene满币将继续深化与社区、媒体合作。', 'According to official news, CoinBene Mancoin and Russian media BitNevoy have reached an in-depth strategic cooperation. The two parties will conduct comprehensive cooperation around virtual currency contract transactions, global market announcements, resource docking, channel dealer recruitment and all-round business development to help users have better Contract experience.\nBitNevoy is a well-known Russian blockchain media that integrates industry news, information, market and other one-stop blockchain services.\nThe CoinBene full-currency digital asset trading platform has more than 5 million users in more than 180 countries and regions around the world, with more than 100,000 daily active users and an average daily transaction volume of 3 billion US dollars. At the beginning of 2019, the platform strategically deploys the contract derivatives market, mainly providing investors with BTC, USDT settlement, safe and stable perpetual contract services. CoinBene Full Coin will continue to deepen cooperation with the community and media.', NULL, '2020-05-14 17:25:53');
INSERT INTO `SysNotice` VALUES ('C6794B8FCF914CE9ACF4EA681F0512BC', 'BTC突破9600美元', 'BTC breaks through $ 9,600', '火币全球站数据显示，BTC短线上涨，达到9600美元关口，现报9600.0美元，日内涨幅5.0%，行情波动较大，请做好风险控制。', 'Data from Huobi Global shows that BTC has risen short-term, reaching the $ 9,600 mark. It is now reported at $ 9600.0, with a daily increase of 5.0%. The market is volatile, so please do a good job in risk control.', NULL, '2020-05-14 17:25:55');
INSERT INTO `SysNotice` VALUES ('F2A122F7DECE4773953F6F8B0243410B', '欧科云链OKLink与FIBOS生态达成战略合作', 'OKLink and FIBOS Ecology reached strategic cooperation', '5月14日，欧科云链OKLink同FIBOS 生态达成战略合作。欧科云链OKLink区块链浏览器将为FIBOS生态用户带来更多样的全面区块链生态体验，并同样将为FIBOS多链生态提供基于API接口的高效率低延时的数据服务。FIBOS斐波是由开发者和区块链行业成员共同发起的社区化公链生态，也是创造和发展区块链应用生态的平台。 欧科云链OKLink是全球首家区块链大数据上市公司打造的区块链信息服务网站，旨在利用区块链+大数据技术为用户提供高可用的区块链信息服务。', 'On May 14th, OKLink and FIBOS Ecology reached a strategic cooperation. Ouke Cloud Chain\'s OKLink blockchain browser will bring FIBOS ecological users a more comprehensive and comprehensive blockchain ecological experience, and will also provide FIBOS multi-chain ecology with high efficiency and low latency data services based on API interfaces. FIBOS is a community-based public chain ecology jointly initiated by developers and members of the blockchain industry. It is also a platform for creating and developing blockchain application ecology. OKLink is the world\'s first blockchain information service website created by a blockchain big data listed company. It aims to use blockchain + big data technology to provide users with highly available blockchain information services.', NULL, '2020-05-14 17:26:00');
