INSERT INTO `SysUpdateInfo` VALUES ('7799589D4EF7409FB700FA7F70DEB232', '水桥', 'com.chouyou.waterbridge', 1, '1.0.0', 30, '为了备战CBA复赛之后的赛程，各支球队都在进行最后的准备。福建队近日就举办了一场队内对抗赛，虽然有外援劳森在，但本土球员仍然是福建队冲击季后赛的关键。而之前一直没能获得机会的刁成灏，接下来也有望获得机会。\n\n刁成灏出生于1995年，身高2.03米，体重100公斤，是一名锋线球员，拥有一定的攻击能力。其中，三分球能力算是他的一个优势。2016-17赛季，他还在青岛队效力时场均可以得到6.3分，场均投中1.6个三分球，三分命中率达到35%，三分线外的表现可圈可点。那个赛季，他在对阵广厦队时投中了5个三分球。\n\n在CBA效力的这6个赛季里，刁成灏虽然表现不是很稳定，但三分球依然是他的优势。去年夏天，他离开广东队转投福建队，为的是希望在福建队获得更多的出场时间，因为他上赛季在广东队获得的机会实在有限。而在去年夏天，刁成灏再次证明了自己的三分球能力。', 0, '2020-06-12 17:58:46', 2, '202006121520504691.apk');
